import { Component } from '@angular/core';
import { RouterOutlet } from '@angular/router';
import { Navbar } from './Navbar/navbar/navbar';
import {Footer} from './comment/footer/footer';
import {Aboutus} from './comment/aboutus/aboutus';

@Component({
  selector: 'app-root',
  imports: [RouterOutlet, Navbar, Footer, Aboutus],
  template: `
    <navbar/>
    <router-outlet/>
    <about />
    <footer />
  `,
  standalone: true
})
export class App { }
